import Item from '../item/item'
import Ticket from '../ticket/ticket'
import './content.css'


function content(getChois) {
    return (
      
       <div className='main-container'>
       <div className='item-list'>
       <Item/>
        </div>
        <p>{this.getChois}</p>
        <div className='ticket'>
        <Ticket/>
        </div>
       </div> 
    );
  }
  
  export default content;
